这是一个Python程序，它会找到给定字符串中第一个不重复的字符并返回其索引。

```python
def first_unique_char(s):
    char_count = {}
    for i, char in enumerate(s):
        if char not in char_count:
            char_count[char] = 1
        else:
            char_count[char] += 1
    for i, char in enumerate(s):
        if char_count[char] == 1:
            return i
    return -1  # 如果所有字符都重复，返回-1

string = "hello world"
print(first_unique_char(string))  # 输出：2
```

在这个程序中，我们首先创建一个字典来存储每个字符及其出现的次数。然后，我们遍历字符串，如果字符在字典中没有，我们就将其添加并计数为1。如果已经在字典中，我们就增加其计数。最后，我们再次遍历字符串，如果找到一个计数为1的字符，那就是第一个不重复的字符，返回其索引。如果没有找到不重复的字符，我们返回-1。

